async function omniBox(e){let t;t=e.startsWith("http:")||e.startsWith("https:")?[[],[]]:await fetch(`/search=${e}`).then((e=>e.json())).catch((e=>console.log("OmniBox Error ignoring..."))),document.getElementById("omnibox-list").innerHTML="",document.getElementById("uv-form").style.marginTop="120px",document.getElementById("omnibox").removeAttribute("class","dnone");try{await t[1].forEach((e=>{document.getElementById("omnibox-list").innerHTML+=`\n                <li class="omniBoxResult" onclick="omniBoxSelect('${e}')">${e}</li> \n                <div id="seperator"></div>\n            `}))}catch(e){t=[[],[]]}0==t[1].length&&(document.getElementById("omnibox-list").innerHTML="",document.getElementById("uv-form").style.marginTop="20px",document.getElementById("omnibox").setAttribute("class","dnone"))}function omniBoxSelect(e){document.getElementById("uv-address").value=e,document.getElementById("uv-form").style.marginTop="20px",document.getElementById("omnibox").setAttribute("class","dnone"),document.getElementById("omnibox-list").innerHTML="",document.getElementById("uv-address").focus(),document.getElementById("uv-form").dispatchEvent(new Event("submit"))}function resetOmniBox(){document.getElementById("uv-form").style.marginTop="20px",document.getElementById("omnibox").setAttribute("class","dnone"),document.getElementById("omnibox-list").innerHTML=""}